import React from 'react';

export default function Login(props) {

    return (
    <section className="login">
        <div className="login__container">
            <h2 className="login__header">Вход</h2>
            <form name="login-form" className="login__form">
                <input type="text" className="login__input" name="login" placeholder="Email" id="email-input"/>
                <input type="text" className="login__input" name="password" placeholder="Пароль" id="password-input"/>
                <button type="submit" className="login__button">Войти</button>
            </form>
            <h3 className="login__text"></h3>
        </div>
    </section>
    )
}
